import React, { Component } from "react";
import Product from "./Product";
import Title from "./Title";

export default class ProductList extends Component {
  render() {
    return (
      <React.Fragment>
        <div className="py-2">
          <div className="container">
            <Title name="prathvi" title="fuck" />
            <div className="row" />
          </div>
        </div>
      </React.Fragment>
    );
  }
}
